import React from 'react';
import '../App.css';
import Boards from './Boards'

import Card from 'react-bootstrap/Card';


const Board = ({ board, onDelete, onToggle }) => {
    return (
        <div className='board'>
            <ListGroup as="ul">
                {boards.map((board, index) => (
                    <ListGroup.Item as="li">
                        <Board key={index} board={board} onDelete={onDelete} onToggle={onToggle} />
                    </ListGroup.Item>

                ))}
            </ListGroup>
        </div>
    )
}

export default Board;
